import React from 'react';
import './HeroStyles.css';
function Hero  (props) {
  return (
    <>
        <div className={props.propName}>
            <img src={props} alt='heroImg'/>
          <div className='hero-text'>
            <h1>Luxury Unleashed, Lively Living</h1>
            <p>Define Your Style.</p>
            <a href='/'>Check Out</a>
          </div>
        </div>
    </>
  )
}

export default Hero;
